import React, { Component } from "react";
import SubNav from "./SubNav";
import TopNav from "./TopNav"


export default class Search extends Component {
  componentDidMount() {}


  render() {
    return (
      <React.Fragment>
        <TopNav />
        <SubNav />
        <div className="emoji-wrapper">
          <i>Search For Emoji:</i>
          <input
            placeholder="SEARCH"
            className="autocomplete"
            type="text"
          /></div>


      </React.Fragment>
    );
  }
}
